import { Button, Container, TextField, Grid } from '@mui/material';
import './App.css';

const keys = [
    { text: '9', value: 9 },
    { text: '8', value: 8 },
    { text: '7', value: 7 },
    { text: '6', value: 6 },
    { text: '5', value: 5 },
    { text: '4', value: 4 },
    { text: '3', value: 3 },
    { text: '2', value: 2 },
    { text: '1', value: 1 },
    { text: '0', value: 0 },
    { text: 'Отправить', value: 'send' },
];

function App() {
  return (
    <Container>
        <Grid container>
            <Grid item md={12} sx={{width: 500}}>
                <TextField id="summ" label="Сумма к снятию" variant="filled" />
            </Grid>
            {keys.map(item => (
                <Grid item md={4}>
                    {(item.value !== 'send') ? (
                        <Button variant="outlined" key={item.value}>{item.value}</Button>
                    ) : (
                        <Button variant="contained" key={item.value}>{item.value}</Button>
                    )}
                </Grid>
                )
            )}
            </Grid>
    </Container>
  );
}

export default App;
